import React from "react";
 
const Popup = props => {
  return (
    <div className="popup-box">
        {props.style==="error" &&
            <div className="box1">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                {props.content}
            </div>
        }
        {props.style==="success" &&
            <div className="box2">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                {props.content}
            </div>
        }
    </div>
  );
};
 
export default Popup;
